document.body.style = 'background: black;';
const Login = ({onLogin})=> {
    const [username, setUsername] = useState ('');
    const [password, setPassword] = useState ('');
    
    const handleLogin = () => {
        if (username&&password) {
            onLogin(username);
        }else{
            alert('')
        };
    }
    
return(

<div>
  <div class="backgroundd">
    
  <form class="formm">
    <h3>Login Here</h3>
    <label htmlFor="username" class="formm">Username</label>
    <input type="text" placeholder="Username" class="formm" value = {username} onChange={(e)=> setUsername(e.target.value)}  />
    <label htmlFor="password" class="formm">Password</label>
    <input type="password" placeholder="Password" class="formm" value = {password} onChange={(e)=> setPassword(e.target.value)}/>
    <button class="formm" type="button" onclick={handleLogin}>Log In</button>
  </form>
  </div>
</div>


